/**
 * Created by agros on 09.06.2019.
 */
import gqt from 'graphql-tag';

export default gqt`
    mutation EditContact (
        $id: String,
        $name: String!,
        $phone: String!,
        $email: String
    ){
        editContact(id: $id, name: $name, phone: $phone, email: $email){
            name
            phone
            email
        }
    }
`;
